import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField';
import FormControl from '@material-ui/core/FormControl';
import InputLabel from '@material-ui/core/InputLabel';
import Files from '../../static/files.json';
import Button from '@material-ui/core/Button';

const useStyles = makeStyles((theme) => ({
  root: {
    display: 'flex',
    flexDirection: 'column',
    justifyItems:'space-between',
  },
  results: {
    border:'solid',
    display: 'flex',
    flexDirection: 'column',
    overflow: 'auto',
    width: '100%',
    paddingTop: theme.spacing(1),
    paddingBottom: theme.spacing(1),
  },
}));


export default function ResultValue({ fileIndex }) {
  const classes = useStyles();
  const resultValue = Files[fileIndex].QAs.map((QA, i) =>
    <FormControl key={i}>
      <InputLabel htmlFor="data"></InputLabel>
      <div style={{ marginBottom: '3%' }}>
        <TextField
          label={QA.Q}
          defaultValue={QA.A}
          variant="outlined"
          fullWidth
        />
      </div>
    </FormControl>
  );

  const handleClick = () => {
    console.log('click');
  }

  return (
    <div className={classes.root}>
      <div className={classes.results}>{resultValue} </div>
      <div style={{ border:'solid', display:'flex', justifyContent: 'right'}}><Button variant="contained" color="secondary" onClick={handleClick}>submit</Button></div>
    </div>
  );
}
